import React from "react";

const Footer = () => {
  return (
    <react-fragment>
      <div className="copyright-area two">
        <div className="container">
          <div className="row">
            <div className="col-lg-12">
              <div className="copyright-area-inner">
                <p>
                  © 2024 MedHelp. All Rights Reserved by 
                  <a>MedHelp</a>
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </react-fragment>
  );
};

export default Footer;
